import React from 'react';

import './customButton.styles.scss';

const CustomButton = ({ children, ...otherProps }) => (
    <div className='button-container'>
        <button className='custom-button' {...otherProps}>
            {children}
        </button>
    </div>
);

export default CustomButton;
